void MOD_OLED_Init()
{
    if (!display.begin(SSD1306_SWITCHCAPVCC))
    {
        Serial.println(F("SSD1306 allocation failed"));
        for (;;)
            ; // Don't proceed, loop forever
    }
    display.clearDisplay();
    initStartTime = millis();
    modOledDt.state = OLED_INIT;
    modOledDt.sleepFlag = false;
}
void MOD_OLED_Task()
{
    if (modOledDt.sleepFlag && (modOledDt.state != OLED_INIT))
        return;

    switch (modOledDt.state)
    {
    case OLED_INIT:
    {
        _OLED_displayInitAnimate();
        unsigned long currentTime = millis();
        if (currentTime - initStartTime > 3000)
            modOledDt.state = OLED_DISPLAY_HOME;
        break;
    }
    case OLED_DISPLAY_HOME:
    {
        _OLED_displayHome();
        break;
    }
    case OLED_DISPLAY_MENU:
    {
        _OLED_displayMenu();
        break;
    }
    case OLED_DISPLAY_SET_CUR_TIME:
    {
        _OLED_displaySetCurTime();
        break;
    }
    case OLED_DISPLAY_SET_ALARM_TIME:
    {
        _OLED_displaySetAlarmTime();
        break;
    }
    }
}

void MOD_OLED_wakeUp()
{
    modOledDt.sleepFlag = false;
}

void MOD_OLED_EnterState(OLED_display_state_t state)
{
    modOledDt.state = state;
    MOD_OLED_wakeUp();
}

static void _OLED_displayInitAnimate()
{
    display.clearDisplay();
    display.drawBitmap(32, 0, frameInit[frame], FRAME_WIDTH, FRAME_HEIGHT, 1);
    display.setTextSize(1);
    display.setTextColor(WHITE);
    display.setCursor(20, 55);
    if (frame & 1)
        display.println("Initializing...");
    else
        display.println("Initializing..");
    display.display();
    frame = (frame + 1) % FRAME_INIT_COUNT;
    delay(FRAME_DELAY);
}

static void _OLED_displayHome()
{
    display.clearDisplay();
    display.setTextSize(1);
    display.setTextColor(WHITE);
    display.setCursor(0, 0);
    display.printf("%uoC   %u%%", modMbRtuDt.tempSensor.value, modMbRtuDt.humSensor.value);
    display.setCursor(106, 1);
    display.drawRect(100, 0, 28, 10, 1);
    display.printf("%u%%", 90);
    display.drawPixel(100, 0, 0);
    display.drawPixel(100, 9, 0);
    display.drawPixel(127, 0, 0);
    display.drawPixel(127, 9, 0);
    display.drawPixel(101, 1, 1);
    display.drawPixel(101, 8, 1);
    display.drawPixel(126, 1, 1);
    display.drawPixel(126, 8, 1);
    display.setTextSize(3);
    display.setCursor(20, 20);
    display.printf("%02u:%02u", modRtc_Dt.cur_Time.hour, modRtc_Dt.cur_Time.minute);
    display.setTextSize(1);
    display.setCursor(27, 55);
    display.printf("Alarm: %02u:%02u", modRtc_Dt.alarm_Time.hour, modRtc_Dt.alarm_Time.minute);
    display.display();
    modOledDt.sleepFlag = true;
}
static void _OLED_displayMenu()
{
    display.clearDisplay();
    display.setTextSize(1);
    display.setTextColor(WHITE);
    display.setCursor(10, 15);
    display.print("1. Set current time");
    display.setCursor(10, 35);
    display.print("2. Set alarm time");
    if (modGpioDt.timeType == 0)
        display.setCursor(0, 15);
    else
        display.setCursor(0, 35);
    display.print(">");

    display.display();
    modOledDt.sleepFlag = true;
}
static void _OLED_displaySetCurTime()
{
    display.clearDisplay();
    display.setTextSize(1);
    display.setTextColor(WHITE);
    display.setCursor(10, 0);
    display.print("1. Set current time");
    display.setTextSize(3);
    display.setCursor(20, 20);
    display.printf("%02u:%02u", modGpioDt.hour, modGpioDt.minute);
    if (modGpioDt.timeType == 0)
        display.drawRect(20, 50, 30, 2, 1);
    else
        display.drawRect(75, 50, 30, 2, 1);

    display.display();
    modOledDt.sleepFlag = true;
}
static void _OLED_displaySetAlarmTime()
{
    display.clearDisplay();
    display.setTextSize(1);
    display.setTextColor(WHITE);
    display.setCursor(10, 0);
    display.print("2. Set alarm time");
    display.setTextSize(3);
    display.setCursor(20, 20);
    display.printf("%02u:%02u", modGpioDt.hour, modGpioDt.minute);
    if (modGpioDt.timeType == 0)
        display.drawRect(20, 50, 30, 2, 1);
    else
        display.drawRect(75, 50, 30, 2, 1);

    display.display();
    modOledDt.sleepFlag = true;
}
